import React from 'react';
import { postsData } from '../postsData.js';
import SinglePost from '../SinglePost/index.jsx';

export default function PostContainer({ postsData }) {
    return (
        <div>
            {
                postsData.map(el => <SinglePost />)
            }
        </div>
    );
}
